import React from "react";

export const ChartBar = () => {
  const value = Math.round(props.value / props.maxValue) * 100 + "&+%";
  return (
    <>
    <div className="chart_outer">
      <div className="chartBar" style={{ height: value }}></div>
    </div>
      <p className="label">{props.label}</p>
    </>
  );
};
